def newman_conway(n):
    memo = {}
    def helper(k):
        if k in memo:
            return memo[k]
        if k == 1 or k == 2:
            result = 1
        else:
            a, b = 1, 1
            for _ in range(3, k + 1):
                a, b = b, b - a + helper(a) + helper(b)
            result = b
        memo[k] = result
        return result
    return helper(n)

