def max_sum_increasing_subseq(arr, i, k, n):
    def max_sum_increasing_subseq_util(arr, i, k, n, memo):
        if i == k:
            return 0
        if i == n:
            return float('-inf')
        if (i, k, n) in memo:
            return memo[(i, k, n)]

        max_sum = float('-inf')
        for j in range(i + 1, n + 1):
            if arr[j] > arr[i]:
                max_sum = max(max_sum, arr[i] + max_sum_increasing_subseq_util(arr, j, k, n, memo))

        if k == n:
            max_sum = max(max_sum, arr[i])

        memo[(i, k, n)] = max_sum
        return max_sum

    memo = {}
    return max_sum_increasing_subseq_util(arr, i, k, n, memo)

