def find_kth(arr1, arr2, k):
    def find_kth_helper(arr1, arr2, k, start1, start2):
        if start1 >= len(arr1):
            return arr2[start2 + k - 1]
        if start2 >= len(arr2):
            return arr1[start1 + k - 1]
        if k == 1:
            return min(arr1[start1], arr2[start2])

        mid1 = min(start1 + k // 2 - 1, len(arr1) - 1)
        mid2 = min(start2 + k // 2 - 1, len(arr2) - 1)

        if arr1[mid1] <= arr2[mid2]:
            return find_kth_helper(arr1, arr2, k - (mid1 - start1 + 1), mid1 + 1, start2)
        else:
            return find_kth_helper(arr1, arr2, k - (mid2 - start2 + 1), start1, mid2 + 1)

    return find_kth_helper(arr1, arr2, k, 0, 0)

