def largest_subset(nums):
    def find_gcd(x, y):
        return gcd(x, y)

    def find_largest_subset(nums):
        if not nums:
            return 0

        nums.sort()
        dp = [1] * len(nums)
        parent = [-1] * len(nums)

        for i in range(len(nums)):
            for j in range(i):
                if nums[i] % nums[j] == 0:
                    if dp[i] < dp[j] + 1:
                        dp[i] = dp[j] + 1
                        parent[i] = j

        max_length = max(dp)
        max_index = dp.index(max_length)

        subset = []
        while max_index != -1:
            subset.append(nums[max_index])
            max_index = parent[max_index]

        return len(subset)

    return find_largest_subset(nums)

