def get_median(list1, list2, n):
    merged_list = []
    i, j = 0, 0

    while i < n and j < n:
        if list1[i] < list2[j]:
            merged_list.append(list1[i])
            i += 1
        else:
            merged_list.append(list2[j])
            j += 1

    while i < n:
        merged_list.append(list1[i])
        i += 1

    while j < n:
        merged_list.append(list2[j])
        j += 1

    if n % 2 == 0:
        return (merged_list[n - 1] + merged_list[n]) / 2.0
    else:
        return merged_list[n // 2]

