def pancake_sort(arr):
    def flip(arr, i):
        start = 0
        while start < i:
            arr[start], arr[i] = arr[i], arr[start]
            start += 1
            i -= 1

    n = len(arr)
    for size in range(n, 1, -1):
        max_index = arr.index(max(arr[:size]))
        if max_index != size - 1:
            if max_index != 0:
                flip(arr, max_index)
            flip(arr, size - 1)
    return arr

