def max_aggregate(tuples_list):
    aggregate_dict = {}
    for name, score in tuples_list:
        if name in aggregate_dict:
            aggregate_dict[name] += score
        else:
            aggregate_dict[name] = score
    return max(aggregate_dict.items(), key=lambda x: x[1])

def max_aggregate(scores):
    from collections import defaultdict
    aggregate = defaultdict(int)
    for name, score in scores:
        aggregate[name] += score
    return max(aggregate.items(), key=lambda x: x[1])

