    max_length = max(len(list1), len(list2), len(list3))
    for i in range(max_length):
        if i < len(list1):
            interleaved.append(list1[i])
        if i < len(list2):
            interleaved.append(list2[i])
        if i < len(list3):
            interleaved.append(list3[i])
    return interleaved

