def unique_sublists(lst):
    result = {}
    for sublist in lst:
        t = tuple(sublist)
        if t in result:
            result[t] += 1
        else:
            result[t] = 1
    return result

from collections import defaultdict

def unique_sublists(sublists):
    count_dict = defaultdict(int)
    for sublist in sublists:
        count_dict[tuple(sublist)] += 1
    return dict(count_dict)

