def get_pairs_count(numbers, target_sum):
    count = 0
    seen = {}
    for number in numbers:
        complement = target_sum - number
        if complement in seen:
            count += seen[complement]
        if number in seen:
            seen[number] += 1
        else:
            seen[number] = 1
    return count

