def odd_length_sum(arr):
    total_sum = 0
    n = len(arr)
    for i in range(n):
        for j in range(i, n):
            if (j - i + 1) % 2 != 0:
                total_sum += sum(arr[i:j+1])
    return total_sum

def odd_length_sum(arr):
    n = len(arr)
    total_sum = 0
    for length in range(1, n + 1, 2):
        for i in range(n - length + 1):
            total_sum += sum(arr[i:i + length])
    return total_sum

assert odd_length_sum([1, 2, 4]) == 14

